import { ResultCard } from './Component/ResultCard.js';

export const Home = () => {

    const [topAnime, setTopAnime] = useState([]);

    useEffect(() => {
        fetch("https://api.jikan.moe/v3/top/anime")
            .then(res => res.json())
            .then((data) => {
                if (!data.errors) {

                    setTopAnime(data.top);
                }

            });
    })

    return (
        <div>
            <div>
                Search
            </div>
